import React from "react";
import img1 from "../../assets/img/img1.png";
import img2 from "../../assets/img/img2.png";
import styles from "./SectionsContainer.module.css"
export default function Section1(){
    return(
        <div class="container">
     <div class="row">
        <div class="col-md-6">
        <h4 class="mb-5">Gwarancja jakości,<span class="d-block py-2">trwałości i różnorodności</span> </h4>
        <p>Firma webshopbouwmaterialen.eu działa na rynku belgijskim. W swojej działalności kierujemy się zasadą indywidualnego podejścia do każdej inwestycji. Kontrolujemy jakość zamawianych materiałów. Bazujemy na markowych produktach firm cieszących się wysoką renomą w branży budowlanej. Nasze usługi skierowane są do: firm budowlanych, inwestorów, biur projektowych, architektów, deweloperów oraz klientów indywidualnych. Webshopbouwmaterialen.eu zapewnia konstruktywną współpracę. Poszukujemy najbardziej wydajnego rozwiązania w kontekście planowanego budżetu. Nasi Klienci mogą liczyć na pełną organizację i sprawną komunikację. Zawsze cechuje nas elastyczność i skrupulatność.</p>
        </div>
        <div class="col-md-6">
        <div className={images_holder}>
        <img src={img2} className={styles.img2}/> 
            <img src={img1} className={styles.img1}/>  
             
        </div>

        </div>
    </div>
        </div>
    )
}
